import React from 'react';

function QuoteHeader() {
    return (
        <div className='QuoteHeader container mx-auto bg-white py-10 px-6 sm:w-260 w-500'>
            <div className="container">
                <img className='mx-auto' src='https://us-belize-trade-demo.s3.amazonaws.com/images/0.png' alt='img' /> 
                <h1 class="text-4xl font-bold text-center">Estimate your Quote</h1>
            </div>

        </div>
    );
}

export default QuoteHeader;
